import React, {Component} from 'react'
import FindFilterBar from '../components/FindFilterBar'

class FindMusicContainer extends Component {

  render() {
    return (
      <div>
        <h2>Find new music:</h2>
        <FindFilterBar />
      </div>
    )
  }
}

export default FindMusicContainer
